O Juiz fez de TUDO pra apitar a favor de vocês, e todo mundo sabe que vocês fazem chuncho com os Juizes, não é coincidencia que é disparado o time que mais sofre Penaltis na competição, e se tiver duvidas, o Athletico é o time que menos sofre. Abraço e continue sangrando, que a gente gosta.

